import React from "react";
import styled from "styled-components";
import Hearder from "../layouts/Header/index";

const ContainerHome = styled.div`
  width: 100%;
  height: 100%;
  display: flex;
  flex-direction: column;
`;

function Index() {
  return (
    <>
      <ContainerHome></ContainerHome>
    </>
  );
}

export default Index;
